does_html_output_location_exist(){

    error_msg="

 We were not able to find a suitable
 Location where to generate the HTML
 file that will show the information
 of the current âyât being played.
 Please make sure your SDCard and/or
 your personal home directory is/are
 readable and writable. This program
 Will exit now...

 Please provide your own output
 directory to the script. Use: -o
 or --output-quran-html-root,
 followed by the full path to folder
 For instance:
 
 `basename $0` -o /home/abu-bakr/quran-files/

"
    
    if [[ -d "/storage/sdcard0" ]]
    then
	outHTMLfile_root="/storage/sdcard0"

    elif [[ -d "/storage/emulated/legacy" ]]
    then
	outHTMLfile_root="/storage/emulated/legacy"

    elif [[ -d "/storage/emulated/0" ]]
    then
	outHTMLfile_root="/storage/emulated/0"

    elif [[ -d "/Removable/MicroSD" ]]
    then
	outHTMLfile_root="/Removable/MicroSD"

    elif [[ -d "/sdcard/external_sd" ]]
    then
	outHTMLfile_root="/sdcard/external_sd"

    elif [[ -d "/storage" ]]
    then
	outHTMLfile_root="/storage"

    elif [[ -d "/sdcard0" ]]
    then
	outHTMLfile_root="/sdcard0"

    elif [[ -d "/sdcard1" ]]
    then
	outHTMLfile_root="/sdcard1"

    elif [[ -d "$HOME" ]]
    then
	outHTMLfile_root="$HOME"
    else
	"$error_msg"
	exit
    fi

    outHTMLfile="$outHTMLfile_root/quran.html"
    tmpOutHTMLfile="$outHTMLfile_root/temp-quran.html"
    outFontsDir="$outHTMLfile_root/.qap_and_rq"
}
# Launch the function
# to get the output folder
does_html_output_location_exist



check_audio_file_exists_or_exit(){
    local file_to_be_played="$1"

    if [[ -f "$file_to_be_played" ]]
    then
	FILE_EXISTS="TRUE"
    else
	echo "The audio file:"
	echo "$file_to_be_played"
	echo "does not exit or is not readable."
	echo "This program will exit now ..."
	echo; exit 1;
    fi;
}


