# fetch ayah and sûrah metadata
get_AyahMetadata_displayThemOnCLI_rq_3_then_1(){
    local file="$1"

    # my unicode symbols:  ⦿ • ‣ ◘ ⌛
    
    actualise_ayah_metadata_vars "$file"
    
    echo
    echo -n "‣File-Loop=$file_loop_repeat_count "
    echo -n "‣MPV-Speed=$playback_speed "
    echo "‣MPV-Loop=$mpv_repeat "
    echo -e -n "◘Total Folders=${BOLD_BLUE}$total_folders${NC} "
    echo -e -n "◘Current One=${BOLD_YELLOW}$folder_name${NC} "
    echo -e "◘Its Size=${BOLD_RED}$folder_size${NC}"
    echo
    echo -e -n "⦿ Sūrah: "
    echo -e -n "${BOLD_BLUE}$surahNameArabic${NC} | "
    echo -n -e "${BOLD_BLUE}$surahNameEnglish${NC} | "
    echo    -e "${BOLD_BLUE}$surahMeccanOrMedinan${NC}"
    echo    -e "⦿ This Āyāh Needs Sudjūd ?: ${BOLD_RED}$sadjdah${NC}"


 # Display the type of table the user requested
 # or the default one if he didn't specify.
 if [[ "$DISPLAY_COMPACT_TABLE" == "TRUE" ]]
 then
     # We need a random integer within a certain range,
     # so, we use the 'modulo' operator. This returns
     # the remainder of a division operation.
     # Note, code adapted from the ABS-Guide of Mendel
     # Cooper which is now in the public domain.

     # Modulo 6 gives range 0 - 6.
     # Incrementing by 1 gives desired range of 1 - 6.
     LIMIT=6

     # set up a new value from 1 to 6
     let "table_number = $RANDOM % $LIMIT +1"

     case "$table_number" in
	 1 )
	     echo "$ayaat_metadata_compact_table_1"
	     ;;
	 2 )
	     echo "$ayaat_metadata_compact_table_2"
	     ;;
	 3 )
	     echo "$ayaat_metadata_compact_table_3"
	     ;;
	 4 )
	     echo "$ayaat_metadata_compact_table_4"
	     ;;
	 5 )
	     echo "$ayaat_metadata_compact_table_5"
	     ;;
	 6 )
	     echo "$ayaat_metadata_compact_table_6"
	     ;;
	 * )
	     echo "$ayaat_metadata_compact_table_1"
	     ;;
     esac

 elif [[ "$DISPLAY_COMPACT_TABLE" == "FALSE" ]]
 then
     LIMIT=6
     # set up a new value from 1 to 6
     let "table_number = $RANDOM % $LIMIT +1"

     case "$table_number" in
	 1 )
	     echo "$ayaat_metadata_table_1"
	     ;;
	 2 )
	     echo "$ayaat_metadata_table_2"
	     ;;
	 3 )
	     echo "$ayaat_metadata_table_3"
	     ;;
	 4 )
	     echo "$ayaat_metadata_table_4"
	     ;;
	 5 )
	     echo "$ayaat_metadata_table_5"
	     ;;
	 6 )
	     echo "$ayaat_metadata_table_6"
	     ;;
	 * )
	     echo "$ayaat_metadata_table_1"
	     ;;
     esac
     
 else
     echo
     echo "I don't know what happened! It seems you don't want"
     echo "to display the standard Âyah and Sûrah metadata table,"
     echo "nor the compact one. Please check your values and if"
     echo "you know how to program, fix this script, this should"
     echo "not have happened! This is an internal error."; echo
 fi

 
 #echo -n "Total Pages of Sûrah is: "
 #echo "$total_number_of_pages_of_surah"
 #echo -n "Current Page of Sūrah: "
 #echo "$current_page_number/$zb"
 #echo -n "Previous Pages of Sūrah: "
 #echo "$previous_number_of_pages_of_surah"
 #echo -n "Remaining pages in Sūrah: "
 #echo "$remaining_number_of_pages_of_surah"; echo    
 #echo -e "⦿ Sūrah N°: ${BOLD_GREEN}$surahNumber${NC}/${BOLD_YELLOW}114 ${NC}"
