 set_up_eta_with_colors_html(){
     ELAPSED_IN_HTML="⌛ <b style=\"color: $jaune_colour\">$(($SECONDS / 3600))-H</b> <b style=\"color: $vert_clair_colour\">$((($SECONDS / 60) % 60))-Mn</b> <b style=\"color: $bleue_ciel_colour\">$(($SECONDS % 60))s</b>"
 }


 set_up_eta_without_colors(){
     ELAPSED_NO_COLOR="⌛ $(($SECONDS / 3600))-H $((($SECONDS / 60) % 60))-Mn $(($SECONDS % 60))s"
 }


 set_up_eta_with_bash_color(){
     ELAPSED_BASH_COLORS="⌛ ${BG_YELLOW_FG_BLACK}$(($SECONDS / 3600))-H${NC} ${BG_RED_FG_BLACK}$((($SECONDS / 60) % 60))-Mn${NC} ${BG_GREEN_FG_BLACK}$(($SECONDS % 60))s${NC}"
 }


 show_termux_notif_bar_only(){
     local audio_file="$1"
     local arrayCount="$2"
     local elmt_numb="$3"
     local cur_loop_num="$4"

     save_eta
     actualise_ayah_metadata_vars $audio_file
     set_up_eta_without_colors

     type termux-notification >/dev/null 2>&1 && {
	 termux-notification -i 9876 -t "Playing: `basename $audio_file`" -c "$(echo $ELAPSED_NO_COLOR) | R.C: { $cur_loop_num/$file_loop_repeat_count } | [ $elmt_numb/$arrayCount ]";

	 termux-notification -i 9867 -t "Sūrah: $surahNumber; $surahNameArabic; $surahNameEnglish; $surahMeccanOrMedinan" -c "$(echo Juz: $juz_number) | $(echo Ḥizb: $hizb_number) | $(echo Ḥizb ¼: ۞ $roubAlHizbNumber) | $(echo Page: $current_page_number) | $(echo Sudjūd: $sadjdah)";	    
     } || {
	 echo "";
     }
     
     # N° of Āyāt os Sūrah: $(echo $number_of_verses_of_surah)
 }



