 display_continuation_msg() {
     
     # Continue with the previous ETA
     if [ -f "$thisScriptRootDir/`basename $0`_ETA.txt" ]
     then
	 SECONDS=$(cat "$thisScriptRootDir/`basename $0`_ETA.txt")
     else
	 echo; echo "$thisScriptRootDir/`basename $0`_ETA.txt"
	 echo "does not exist. Set the elapsed time to 00h-00mn-00s"; echo
     fi
     
     echo; echo -e "${BG_WHITE_FG_BLACK}Resuming a previously saved playback session...${NC}"
     
     #mpv --vid=no --msg-level=all=no --speed=1.6 \
	 #"$thisScriptRootDir/helper_audios/Resuming a previously saved playback session.ogg" \
	 #"$thisScriptRootDir/helper_audios/Resuming a previously saved playback session_Fra.ogg" 2> /dev/null; echo

     if [[ $NO_HELPER_AUDIOS_FRA == "FALSE" ]]
     then
	 printf "${launch_saved_session_Fra}" | base64 -d | mpv --vid=no --msg-level=all=no --speed=1.6 - 2> /dev/null
     fi

     if [[ $NO_HELPER_AUDIOS_ENG == "FALSE" ]]
     then
	 printf "${launch_saved_session}" | base64 -d | mpv --vid=no --msg-level=all=no --speed=1.6 - 2> /dev/null
     fi
 }



 display_verse_translation(){
     # This function should be used to display
     # the translation of verses at the time
     # their audio versions are being played
     # at the command line. This is why we do
     # not show the translation of verses from
     # Hilali-Khan: because we do not have the
     # audio version. However, we may write it
     # in the html output file if the user asks
     local verse_trans="$1"
     local lang="$2"

     echo
     case "$lang" in
         fra-hamidullah)
	     if [[ "$SHOW_HAMIDULLAH_FRA_TEXT" == "TRUE" ]]
	     then
		 echo -e "${UNDERLINE}Interprétation du Verset:${NC} Ḥamidullah"

		 if [[ -f "$verse_trans" ]]
		 then
		     echo -e "${BOLD_BLUE}$(cat "$verse_trans")${NC}"
		 else
		     echo "Le fichier contenant l'interprétation du"
		     echo "sens du verse Coranique suivant:"
		     echo "'$verse_trans'"
		     echo "est absent ou inaccessible."
		 fi
	     fi
	     ;;
         eng-sahih-int)
	     if [[ "$SHOW_SAHIH_INT_ENG_TEXT" == "TRUE" ]]
	     then
		 echo -e "${UNDERLINE}Verse Interpretation:${NC} Ṣaḥîḥ Int."

		 if [[ -f "$verse_trans" ]]
		 then
		     echo -e "${BOLD_GREEN}$(cat "$verse_trans")${NC}"
		 else
		     echo "The english verse interpretation file:"
		     echo "'$verse_trans'"
		     echo "Is not accessible"
		 fi
	     fi		
	     ;;
	 transliteration)
	     if [[ "$SHOW_TRANSLITERATION" == "TRUE" ]]
	     then
		 echo -e "${UNDERLINE}Transliteration/Translitération:${NC}"

		 if [[ -f "$verse_trans" ]]
		 then
		     echo -e "${BOLD_YELLOW}$(cat "$verse_trans")${NC}"
		 else
		     echo "The verse transliteration file:"
		     echo "'$verse_trans'"
		     echo "Is not accessible"
		 fi
	     fi
	     ;;
	 *)
	     if [[ -f "$verse_trans" ]]
	     then
		 echo -e "${UNDERLINE}Verse Interpretation:${NC} Other"

		 echo -e "${BOLD_BLUE}$(cat "$verse_trans")${NC}"
	     else
		 echo "The interpretation file:"
		 echo "'$verse_trans'"
		 echo "Is not accessible"
	     fi
     esac
     echo
 }



 show_progress_in_html_file(){
     local  is_playing="$1"
     local  all_elmts_numb="$2"
     set_up_eta_with_colors_html # this
     # is a function

     if [[ "$readOnceDel1stElmt_FLAG" == "yes" ]]
     then
	 echo -n "$(echo $ELAPSED_IN_HTML)"
	 echo -n " | "
	 echo -n 'Remains '
	 echo -n '<b style="color: cyan">'
	 echo -n "$all_elmts_numb"
	 echo -n '</b> Āyāt'
     else
	 echo -n "$(echo $ELAPSED_IN_HTML)"
	 echo -n " | "
	 echo -n 'Āyah [ '
	 echo -n '<b style="color: cyan">'
