 #cat /dev/null > "$output_file_tmp"
 #cat /dev/null > "$output_file"
 get_file_duration(){

     check_playlist_creation_deps
     echo; type awk >/dev/null 2>&1 || {
	 echo >&2 "Please intall Gawk on your system. Operation aborted!"; echo; exit 1;
     }
     
     local file="$1"
     OLDIFS=$IFS; IFS=':'
     read hours minutes seconds <<< $(duration=$(ffprobe "$file" 2>&1 | awk '/Duration/ { print $2 }'); echo "$duration" | cut -sf1 -d "." )
     IFS=$OLDIFS

     # Removing leading zeros
     while [ "$hours" != "${hours#0}" ]
     do
	 hours=${hours#0}
     done
     while [ "$minutes" != "${minutes#0}" ]
     do
	 minutes=${minutes#0}
     done
     while [ "$seconds" != "${seconds#0}" ]
     do
	 seconds=${seconds#0}
     done

     # Another way of doing it
     #b=$(echo $a | sed 's/^0*//')
     
     total_secs=$((((hours*60)*60)+(minutes*60)+seconds))
     echo -n `basename "$file"` >> "$output_file_tmp"
     echo "=\"$total_secs"\" >> "$output_file_tmp"
 }
