 conv_fake_audios_to_line_numbers_parse_playlists_get_ayaat_path(){
     local playlist_files_dir="$1"
     
     # get into the folder containing
     # the tafsir files in plain text
     if [[ ! -d "$playlist_files_dir" ]]
     then
	 echo; echo
