	 echo; exit 1
     fi

     # parsing the playlist files
     for file in "$playlist_files_dir"/*.$playlist_file_ext
     do
	 echo; echo "Working with file:"
	 echo `readlink --canonicalize-existing "${file}"`; echo

	 # expand ${list_of_fake_audio_ayaat_files_to_convert_to_line_numbers[@]}"
	 # into a list of options that are passed to the function
	 # convert_surahAndAyahNumber_to_tanzil_ayahLineNumber

