	 mapfile -t ayat_full_path_to_pass_to_mpv < <(open_playlist_for_sed_look_up)
	 
	 # Debug #
	 #echo; echo
	 #echo "ayat_full_path_to_pass_to_mpv:"
	 #echo "${ayat_full_path_to_pass_to_mpv[@]}"
	 #echo; exit 1

	 # Sorting the array
	 OLDIFS=$IFS; IFS=' '
	 sorted_ayat_full_path_to_pass_to_mpv=($(sort <<<"${ayat_full_path_to_pass_to_mpv[*]}"))
	 IFS=$OLDIFS
	 
	 # The array containing the full paths of ayahs that we obtained
	 # from the Playlist file is a global variable and if we reach
	 # here, it has already been set up avbove. So, the quran reading
	 # function uses it directly, without having it passed to it as a
	 # positional parameter.

	 ########
	 ########
	 ########
	 
	 # the array that mpv will use for playback is:
	 # "${sorted_ayat_full_path_to_pass_to_mpv[@]}"
     done
 }



