	 echo; exit 1
     fi
     
     find "$quran_folder" \
	  -name \
	  *.$quran_files_extension 2> /dev/null \
	 | parallel --jobs=200 "

current_file=$(readlink --canonicalize-existing {})

if [[ ! -f $current_file ]]
then
    echo
    echo "file does not exist: $current_file"
    echo
    exit
fi

    echo $current_file >> tmp_$playlist_name.${playlist_file_ext%%.7z}"

     cat "tmp_$playlist_name.${playlist_file_ext%%.7z}" \
	 | sort | uniq > "$playlist_name.${playlist_file_ext%%.7z}"

     7z a -t7z -m0=lzma -mx=9 -mfb=64 -md=32m -ms=on \
	"${playlist_name}.$playlist_file_ext" \
	"${playlist_name}.${playlist_file_ext%%.7z}"

     echo
