	"$default_playlists_dir_script_root"
     
     echo
     rm -rfv "tmp_$playlist_name.${playlist_file_ext%%.7z}"
     
     echo
     rm -rfv "$playlist_name.${playlist_file_ext%%.7z}"
     echo; exit
 }

 
