 generate_fake_audio_files(){

     local NUM_OF_AYAT_IN_FOLDER=$1

     fake_audios_dir_suffix=$(date +%A.%d.%B.%Y-%Hh.%Mmn.%Ss)

     fake_audios_error_msg_1="
The following default directories do not exist:"

     fake_audios_error_msg_2="
This means you do not have any Playlists
files ready to be used, for the time being.
We will create the default Playlist directory:"

     fake_audios_error_msg_3="
and create the fake audios directory in it."
     
     echo; type find >/dev/null 2>&1 || {
	 echo >&2 "Please install 'find' from the findutils package. Operation aborted!"; echo; exit 1;
     }

     echo; type parallel >/dev/null 2>&1 || {
	 echo >&2 "Please install the GNU parallel package on your system. Operation aborted!"; echo; exit 1;
     }


     create_fake_ayahs_in_root_folder(){
	 for ayah_id in "${array_list_of_all_quran_verses_by_id[@]}"
	 do
	     echo;
	     echo "Creating fake audio file: '$ayah_id.$fakeAudioFileExt'"
	     touch "$ayah_id.$fakeAudioFileExt"
	     # double-try
	     cat /dev/null > "$ayah_id.$fakeAudioFileExt"
	 done
     }

     move_fake_ayaat_into_subdirectories(){
	 numOfQuranVerses=6236
	 numOfFolders=$(((numOfQuranVerses/number_of_fake_audios_per_folder)+1))
	 # Bash doesn't recognize numbers with dots. It will truncate the numbers
	 # after the zero. 415.58 becomes 415. We add 1 to make sure the rest of
	 # the files get a folders of their own. Note that the number of files in
	 # the last folder will never be the same as the number in the other files
	 starting_num=1

	 for i in `seq --equal-width $starting_num $numOfFolders`
	 do
	     mkdir -p "dir_$i" && echo; echo "Creating folder: $dir_$i"
	     find . -maxdepth 1 -type f | sort | head -n $number_of_fake_audios_per_folder | parallel --line-buffer --jobs=32 "mv -f {} dir_$i"
	 done
     }

     
     if [[ -d "$default_playlists_dir_script_root" ]]
     then
	 mkdir -p "$default_fake_audios_directory_script_root"-"$fake_audios_dir_suffix"
	 cd "$default_fake_audios_directory_script_root"-"$fake_audios_dir_suffix"

	 if [[ ! "$NUM_OF_AYAT_IN_FOLDER" == "DIV_RUB_HIZB" ]]
	 then
	     create_fake_ayahs_in_root_folder && \
		 move_fake_ayaat_into_subdirectories
	 else
	     create_fake_ayahs_in_root_folder && \
	     move_fake_ayaat_into_rub_ul_hizb_subdirs
	 fi
	 
	 
     elif [[ -d "$default_playlists_dir_home_folder" ]]
     then
	 mkdir -p "$default_fake_audios_directory_home_folder"-"$fake_audios_dir_suffix"
	 cd "$default_fake_audios_directory_home_folder"-"$fake_audios_dir_suffix"

	 if [[ ! "$NUM_OF_AYAT_IN_FOLDER" == "DIV_RUB_HIZB" ]]
	 then
	     create_fake_ayahs_in_root_folder && \
		 move_fake_ayaat_into_subdirectories
	 else
	     create_fake_ayahs_in_root_folder && \
	     move_fake_ayaat_into_rub_ul_hizb_subdirs
	 fi
	 
     else
	 echo "$fake_audios_error_msg_1"
	 echo "$default_playlists_dir_script_root"
	 echo "$default_fake_audios_directory_home_folder"
	 echo "$fake_audios_error_msg_2"
	 echo "$default_playlists_dir_script_root"
	 echo "$fake_audios_error_msg_3"

	 mkdir -p "$default_fake_audios_directory_script_root"-"$fake_audios_dir_suffix"
	 cd "$default_fake_audios_directory_script_root"-"$fake_audios_dir_suffix"

	 if [[ ! "$NUM_OF_AYAT_IN_FOLDER" == "DIV_RUB_HIZB" ]]
	 then	     
	     create_fake_ayahs_in_root_folder && \
		 move_fake_ayaat_into_subdirectories
	 else
	     create_fake_ayahs_in_root_folder && \
	     move_fake_ayaat_into_rub_ul_hizb_subdirs
	 fi
     fi
     
     exit $?
 }



 create_RECITE_ONCE_THRICE_and_LAST_files_with_fake_audios_and_playlist(){

     if [[ -d "$default_playlists_dir_script_root" ]]
     then
	 cd "$default_fake_audios_directory_script_root"
	 ALL_DIRS_ARRAY=($(for folder in *; do if [ -d "$folder" ]; then echo "$folder" | sort; fi; done))
	 first_folder="${ALL_DIRS_ARRAY[0]}"
	 verse_folder="$first_folder"
	 verse_folder_full_path=$(readlink --canonicalize-existing "$verse_folder")
	 
     elif [[ -d "$default_playlists_dir_home_folder" ]]
     then
	 cd "$default_playlists_dir_home_folder"
	 ALL_DIRS_ARRAY=($(for folder in *; do if [ -d "$folder" ]; then echo "$folder" | sort; fi; done))
	 first_folder="${ALL_DIRS_ARRAY[0]}"
	 verse_folder="$first_folder"
	 verse_folder_full_path=$(readlink --canonicalize-existing "$verse_folder")
     else
	 echo
	 echo "Error: None of the following folders:"
	 echo
	 echo "$default_fake_audios_directory_script_root"
	 echo "$default_fake_audios_directory_home_folder"
	 echo
	 echo "Is accessible! The creation of the files:"
	 echo
	 echo "-RECITE_ONCE_LIST"
	 echo "-RECITE_THRICE_LIST"
	 echo "-RECITE_LAST_LIST"
	 echo
	 echo "is not possible since there are no fake audios"
	 echo "since even the Playlist directory and files do"
	 echo "not exist. Will exit now..."
	 echo
	 exit 1
     fi

     # This code was copied from 'main_function', refer to it since it is well-commented there. Get into the first fake audios folder since it is from there the playback starts always. So, if the user requested the generation of stage-1 or 2 files, it is there that we do it
     cd "$verse_folder_full_path"
     list_of_fake_audio_ayaat_files_to_convert_to_line_numbers=($(for file in *.$fakeAudioFileExt; do echo "${file%%.$fakeAudioFileExt}" | sort; done))

     # debug #
     #echo; echo
