     #echo "${list_of_fake_audio_ayaat_files_to_convert_to_line_numbers[@]}"
     #echo; exit 1

     if [[ -d "$default_playlists_dir_script_root" ]]
     then
	 conv_fake_audios_to_line_numbers_parse_playlists_get_ayaat_path "$default_playlists_dir_script_root"

     elif [[ -d "$default_playlists_dir_home_folder" ]]
     then
	 conv_fake_audios_to_line_numbers_parse_playlists_get_ayaat_path "$default_playlists_dir_home_folder"
     fi

     RECITE_1_ARRAY=("${sorted_ayat_full_path_to_pass_to_mpv[@]}")
     RECITE_3_ARRAY=("${sorted_ayat_full_path_to_pass_to_mpv[@]}")
     RECITE_LAST_ARRAY=("${sorted_ayat_full_path_to_pass_to_mpv[@]}")

     # debug #
     #echo; echo "RECITE_1_ARRAY"
     #echo "${RECITE_1_ARRAY[@]}"
     #echo; echo "RECITE_3_ARRAY"
     #echo "${RECITE_3_ARRAY[@]}"
     #echo; echo "RECITE_LAST_ARRAY"
     #echo "${RECITE_LAST_ARRAY[@]}"
     #echo; exit
     
     create_RECITE_ONCE_FILE(){
	 # create the empty RECITE_ONCE_LIST file
	 touch "$verse_folder_full_path"/RECITE_ONCE_LIST
	 touch "$verse_folder_full_path"/RECITE_ONCE_LIST.bak
	 cat /dev/null > "$verse_folder_full_path"/RECITE_ONCE_LIST
	 cat /dev/null > "$verse_folder_full_path"/RECITE_ONCE_LIST.bak
	 # save list contents in that file
	 for elmt in "${RECITE_1_ARRAY[@]}"
	 do
	     echo "$elmt" >> "$verse_folder_full_path"/RECITE_ONCE_LIST
	     echo "$elmt" >> "$verse_folder_full_path"/RECITE_ONCE_LIST.bak
	 done
     }

     create_RECITE_THRICE_FILE(){
	 # create the RECITE_THRICE_LIST empty file
	 touch "$verse_folder_full_path"/RECITE_THRICE_LIST
	 touch "$verse_folder_full_path"/RECITE_THRICE_LIST.bak
	 cat /dev/null > "$verse_folder_full_path"/RECITE_THRICE_LIST
	 cat /dev/null > "$verse_folder_full_path"/RECITE_THRICE_LIST.bak
	 # save list contents in that file
	 for elt in "${RECITE_3_ARRAY[@]}"
	 do
	     echo "$elt" >> "$verse_folder_full_path"/RECITE_THRICE_LIST
	     echo "$elt" >> "$verse_folder_full_path"/RECITE_THRICE_LIST.bak
	 done
     }

     create_RECITE_LAST_FILE(){
	 # create the RECITE_LAST_LIST empty file
	 touch "$verse_folder_full_path"/RECITE_LAST_LIST
	 touch "$verse_folder_full_path"/RECITE_LAST_LIST.bak
	 cat /dev/null > "$verse_folder_full_path"/RECITE_LAST_LIST
	 cat /dev/null > "$verse_folder_full_path"/RECITE_LAST_LIST.bak
	 # save list contents in that file
	 for elt in "${RECITE_LAST_ARRAY[@]}"
	 do
	     echo "$elt" >> "$verse_folder_full_path"/RECITE_LAST_LIST
	     echo "$elt" >> "$verse_folder_full_path"/RECITE_LAST_LIST.bak
	 done
     }

     if [[ "$FIRST_STAGE_OR_LAST_STAGE" -eq 1 ]]
     then
	 # The user wants to generate the first stage files
	 create_RECITE_ONCE_FILE
	 create_RECITE_THRICE_FILE
     else
	 create_RECITE_LAST_FILE
     fi
 }



 main_function(){

     # Isti`âdha
     #mpv --vid=no --speed=1.0 "$thisScriptRootDir/helper_audios/audhubillah.oga" 2> /dev/null; echo
     printf "${audhubillah}" | base64 -d | mpv --vid=no --speed=1.0 - 2> /dev/null
     
     if [[ -d "$default_fake_audios_directory_script_root" ]]
     then
	 cd "$default_fake_audios_directory_script_root"

     elif [[ -d "$default_fake_audios_directory_home_folder" ]]
     then
	 cd "$default_fake_audios_directory_home_folder"
     else
	 echo; echo
	 echo "Error: None of the following folders:"; echo
	 echo "$default_fake_audios_directory_script_root"
	 echo "$default_fake_audios_directory_home_folder"
	 echo; echo "Is accessible! Will exit now..."; echo
	 exit 1
     fi

     # the following will get for us the number of sub-folders in the current directory
     total_folders_array=($(for ayat_folder in *;  do if [ -d  "$ayat_folder" ]; then echo "$ayat_folder" | sort; fi; done))
     total_folders=${#total_folders_array[@]}

     # Go through all the folders
     # and start the playback, one
     # folder after the other
     for folder in *
     do
	 if [ -d "$folder" ]
	 then
	     folder_name="$folder"
	     #folder_size=`du -sh "$folder" | cut -f1`
	     # here, it only gets the size of the folder of fake audios. We need to operate on the array containing the path of the real files
	     
             cd "$folder"
             # get into the folder holding thebfake audios of ayaat. populate the array that will hold the fake audio files. This array is a global variable. If we populate it here it will be accessible to all the remaining components of this program.
	     list_of_fake_audio_ayaat_files_to_convert_to_line_numbers=($(for file in *.$fakeAudioFileExt; do echo "${file%%.$fakeAudioFileExt}" | sort; done)) # add the file to the array and remove its extension

	     # debug #
	     #echo; echo
	     #echo "list_of_fake_audio_ayaat_files_to_convert_to_line_numbers:"
	     #echo "${list_of_fake_audio_ayaat_files_to_convert_to_line_numbers[@]}"
	     #echo; exit 1

	     # Now we call the following function and it will access the global array above and convert these fake audio files into line numbers in the Playlist file. These lines correspond to the real location of the files that we would like to play. This function will also invoque for us, the
	     # 'conv_fake_audios_to_line_numbers_parse_playlists_get_ayaat_path'
	     # function
	     if [[ -d "$default_playlists_dir_script_root" ]]
	     then
		 conv_fake_audios_to_line_numbers_parse_playlists_get_ayaat_path "$default_playlists_dir_script_root"

	     elif [[ -d "$default_playlists_dir_home_folder" ]]
	     then
		 conv_fake_audios_to_line_numbers_parse_playlists_get_ayaat_path "$default_playlists_dir_home_folder"
	     else
		 echo; echo
		 echo "The Default or User-Provided Playlist"
		 echo "folder is not accessible:"; echo
		 echo "$default_playlists_dir_script_root"
		 echo "$default_playlists_dir_home_folder"
		 echo "The program will exit."
		 echo; exit
	     fi
	     
	     # generate the initial HTML file
	     gen_beginning_html >> "$outHTMLfile"

	     ## Launch Firefox with
	     ## our webpage
	     type am >/dev/null 2>&1 && {
		 # Mozilla Firefox
		 echo
		 am start -a android.intent.action.VIEW -n org.mozilla.firefox/.App -d "file:///$outHTMLfile";
		 echo

		 # Google Chrome
		 # echo
		 # am start -n com.android.chrome/com.google.android.apps.chrome.Main -a android.intent.action.VIEW -d "file:///$outHTMLfile"
		 # echo
		 
	     } || {
		 echo "Please install Mozilla Firefox";
		 #echo "Please install Google Chrome";
	     } &

	     # get the size of the real files
	     folder_size=$(du -shc $(echo "${sorted_ayat_full_path_to_pass_to_mpv[@]}") | tail -n1 | cut -f1 | head -n1)

	     
	     ## launch the session
	     readThriceThenOnce
             readOnceDelete1stElmtEachTime
	     # Removing array elmts
	     unset RECITE_3_ARRAY
	     unset RECITE_1_ARRAYY
	     unset r_ONE_DelTopEL_AR
	     unset NUMB_OF_FILES
	     unset NUMB_OF_FILES_ARRAY
	     unset ayat_full_path_to_pass_to_mpv
	     unset sorted_ayat_full_path_to_pass_to_mpv
	     unset list_of_fake_audio_ayaat_files_to_convert_to_line_numbers
	     unset array_of_lines_to_be_looked_up_by_sed
	     
	     
             cd .. && \
		 mkdir -v -p ./tahfeez-P-per-P-bak
             mv -v "$folder" ./tahfeez-P-per-P-bak
             # we reset the ETA
             SECONDS=0
	     
	     # exit $? # End session
	     
	 fi
     done
 }


