 check_numeric_values_have_been_provided(){
     local pos_param="$1"
     local error_msg_text="$2"
     # numeric values are needed
     case "pos_param" in
	 [a-z])
	     echo
	     echo "$error_msg_text"
	     echo
	     echo "The value you entered is: $pos_param"
	     echo; exit 1
	     ;;
	 * )
	     # Everything is okay
	     ;;
     esac
 }



 OPTS=`getopt -o d:e:f:hkl:m:o:C:G:L:R: --long mpv-speed:,mpv-loop:,file-loop:,directory-of-fake-audios:,output-quran-html-root:,playlist-file-root:,generate-playlist:,extension-of-audios:,create-fake-audios:,generate-rortrl-files:,ara-font-size:,lat-font-size:,metadata-font-size:,table-font-size:,system-font-name:,user-font-number:,compact-table,eng-audio,fra-audio,no-ara-txt,translit,eng-txt-sahih,eng-txt-hilali-khan,fra-txt-hamid,no-helper-audios-fra,no-helper-audios-eng,help -- "$@"`

 if [ $? != 0 ]
 then
     echo; echo "Failed parsing options." >&2
     echo "$usage"
     exit 1
 fi

 eval set -- "$OPTS"

 while true; do
     case "$1" in
	 -m|--mpv-speed )
	     check_numeric_values_have_been_provided "$2" "$error_msg_mpv_playback_speed"
	     playback_speed="$2"
	     shift 2
	     ;;
	 -l|--mpv-loop )
	     check_numeric_values_have_been_provided "$2" "$error_msg_mpv_internal_loop"
	     mpv_repeat="$2"
	     shift 2
	     ;;
	 -f|--file-loop )
	     check_numeric_values_have_been_provided "$2" "$error_msg_file_loop"
	     file_loop_repeat_count="$2"
	     shift 2
	     ;;
	 -r|--reset-eta )
	     reset_eta="true"
	     shift
	     ;;
	 -d|--directory-of-fake-audios )
	     user_entered_fake_audios_directory="$2"
	     if [[ -d "$user_entered_fake_audios_directory" ]]
	     then
		 # Override our default values with
		 # the one provided by the user
		 default_fake_audios_directory_script_root="$user_entered_fake_audios_directory"
		 default_fake_audios_directory_home_folder=""
		 # Clear this to avoid having two vars
		 # pointing to the same location.		
	     else
		 echo
		 echo "The Playlist folder you provided:"
		 echo "$user_entered_fake_audios_directory"
		 echo "is either unavailable or unreadable"
		 echo "We revert to the default one."; echo
	     fi
	     shift 2
	     ;;
	 -C|--create-fake-audios )
	     # If the user enters R or r we divide the
	     # fake audios into rub-ul-hizb directories
	     if [[ "$2" == "R" || "$2" == "r" ]]
	     then
		 generate_fake_audio_files "DIV_RUB_HIZB"		 
	     else
		 check_numeric_values_have_been_provided "$2" "$error_msg_fake_audios_creation"
		 number_of_fake_audios_per_folder="$2"
		 generate_fake_audio_files "DIV_PER_PROVIDED_NUMBER"
	     fi	     
	     shift 2
	     exit $?
	     ;;
	 -o|--output-quran-html-root )
	     # Try to create the files
	     touch "${2}/quran.html"
	     touch "${2}/temp-quran.html"
	     # double-try
	     cat /dev/null > "${2}/quran.html"
	     cat /dev/null > "${2}/temp-quran.html"
	     #
	     # If we were able to create them, then
	     # we'll use them, otherwise we work
	     # with the default ones.
	     if [[ -f "${2}/quran.html" ]]
	     then
		 outHTMLfile="${2}/quran.html"
	     else
		 echo
		 echo "We were not able to create the file:"
		 echo "${2}/quran.html"; echo
		 echo "We revert to the default one."; echo
	     fi
	     
	     if [[ -f "${2}/temp-quran.html" ]]
	     then
		 tmpOutHTMLfile="${2}/temp-quran.html"
	     else
		 echo
		 echo "We were not able to create the file:"
		 echo "${2}/temp-quran.html"; echo
		 echo "We revert to the default one."; echo
	     fi
	     shift 2
	     ;;
	 -L|--playlist-file-root )
	     user_entered_playlists_folder="$2"
	     if [[ -d "$user_entered_playlists_folder" ]]
	     then
		 # Override our default values with
		 # the one provided by the user
		 default_playlists_dir_script_root="$user_entered_playlists_folder"
		 default_playlists_dir_home_folder=""
		 # Clear this to avoid having two vars
		 # pointing to the same location.
	     else
		 echo
		 echo "The Playlist folder you provided:"
		 echo "$user_entered_playlists_folder"
		 echo "is either unavailable or unreadable"
		 echo "We revert to the default one."; echo
	     fi
	     shift 2
	     ;;
	 --ara-font-size )
	     check_numeric_values_have_been_provided "$2" "$error_msg_font_size_ara"
	     ARABIC_TEXT_FONT_SIZE="$2em"
	     shift 2
	     ;;
	 --lat-font-size )
	     check_numeric_values_have_been_provided "$2" "$error_msg_font_size_lat"
	     LATIN_TEXT_FONT_SIZE="$2em"
	     shift 2
	     ;;
	 --metadata-font-size )
	     check_numeric_values_have_been_provided "$2" "$error_msg_font_size_metadata"
	     METADATA_FONT_SIZE="$2em"
	     shift 2
	     ;;
	 --table-font-size )
	     check_numeric_values_have_been_provided "$2" "$error_msg_font_size_table"
	     TABLE_FONT_SIZE="$2em"
	     shift 2
	     ;;
	 --system-font-name )
	     case "$2" in
		 "" | " " | *[0-9]* )
		     echo "$error_msg_font_name"
		     ;;
	         * )
		     SYSTEM_FONTS_NAMES="$2"
		     USER_FONT_FLAG="FALSE"
		     SYSTEM_FONT_FLAG="TRUE"
		     ;;
	     esac
	     shift 2
	     ;;
	 --user-font-number )
	     echo; echo "This feature is broken for now"; echo; exit
	     check_numeric_values_have_been_provided "$2" "$error_msg_user_provided_font"
	     chosen_font_number="$2"
	     USER_FONT_FLAG="TRUE"
	     SYSTEM_FONT_FLAG="FALSE"
	     shift 2
	     ;;
	 -k|--compact-table )
	     DISPLAY_COMPACT_TABLE="TRUE"
	     shift 1
	     ;;
	 --eng-audio )
	     PLAY_ENG_AUDIO="TRUE"
	     shift
	     ;;
	 --fra-audio )
	     PLAY_FRA_AUDIO="TRUE"
	     shift
	     ;;
	 --no-ara-txt )
	     SHOW_ARA_TEXT="FALSE"
	     shift
	     ;;
	 --translit )
	     SHOW_TRANSLITERATION="TRUE"
	     shift
	     ;;
	 --eng-txt-sahih )
	     SHOW_SAHIH_INT_ENG_TEXT="TRUE"
	     shift
	     ;;
	 --eng-txt-hilali-khan )
	     SHOW_H_K_ENG_TEXT="TRUE"
	     shift
	     ;;
	 --fra-txt-hamid )
	     SHOW_HAMIDULLAH_FRA_TEXT="TRUE"
	     shift
	     ;;
	 --no-helper-audios-fra )
	     NO_HELPER_AUDIOS_FRA="TRUE"
	     shift
	     ;;
	 --no-helper-audios-eng )
	     NO_HELPER_AUDIOS_ENG="TRUE"
	     shift
	     ;;
	 -h|--help )
	     echo "$usage"
	     shift
	     exit $?
	     ;;
	 -R|--generate-rortrl-files )
	     check_numeric_values_have_been_provided "$2" "$error_msg_rortrl_files_creation"
	     FIRST_STAGE_OR_LAST_STAGE="$2"
	     create_RECITE_ONCE_THRICE_and_LAST_files_with_fake_audios_and_playlist
	     shift 2
	     exit $?
	     ;;
	 -e|--extension-of-audios )
	     quran_files_extension="$2"
	     shift 2
	     ;;
	 -G|--generate-playlist )
	     quran_folder="$2"
	     if [[ -d "$quran_folder" ]]
	     then	    
		 playlist_name=`basename "$quran_folder"`
		 # Debug
		 echo; echo "Quran Folder: $quran_folder"
		 echo "Quran Files Extension: $quran_files_extension" 
		 echo "Playlist Name: $playlist_name"; echo; echo #; exit
		 generate_playlist_file # function
	     else
		 echo
		 echo "The folder you provided, where the"
		 echo "Quran files for which you would like"
		 echo "to have a Playlist file generated,"
		 echo "are supposed to be located,"
		 echo "is either unavailable or unreadable."
		 echo "Will exit now..."
	     fi
	     shift 2
	     exit $?
	     ;;
	 -- )
	     shift
	     break
	     ;;
     esac
 done




 # Launch a new session
 # or resume the saved one
 main_function

 exit $?


